import React from "react";
import { Route, Switch, Router } from "react-router-dom";
import Home from "./Home";

import "./App.css";
import { Navbar } from "./components/Navbar";

const App = () => (
  <Router>
    <Switch>
      <Navbar />
      <Route exact={true} path="/" component={Home} />
    </Switch>
  </Router>
);

export default App;
